import React from 'react';

import {Text, View, StyleSheet} from 'react-native'

export default function LoginScreen() {
    return (
        <View style = {styles.Leftcircle} ></View>
      
    );
}
const styles =StyleSheet.create({
    Leftcircle:{
        backgroundColor: '#23a6d5',
        position: 'absolute',
        width: 200,
        height: 200,
        borderRadius: 100,
        left: -50,
        top:-50,
    },
})
